svg.script:


function EventClick(evt)
{
var wileylink = evt.target.id;
if (wileylink == "RECTELEARN") {
        window.open("https://www.wileyplus.com/WileyCDA/");
  }
else if (wileylink == "RECTPROFDEV") {
 	       window.open("https://www.efficientlearning.com/");
  }
else if (wileylink == "RECTSCIENTPUBL") {
  	      window.open ("http://onlinelibrary.wiley.com/");
  }

else if (wileylink == "RECTONLINEJOUR") {
  	  	   window.open("http://onlinelibrary.wiley.com/browse/publications?type=journal");
  }
}
